import React from "react";
import { NavbarContainer, NavLogo, Nav } from "./NavbarElements";
const Navbar = () => {
  return (
    <>
      <Nav>
        <NavbarContainer>
                  <NavLogo to="/">Moneys</NavLogo>
                  <MobileIcon>
                      <FaBars />

                  </MobileIcon>

        </NavbarContainer>
      </Nav>
    </>
  );
};

export default Navbar;
